import React , { useState, useEffect } from "react";
import { Line } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

export default function ReactChart() {
  const url ='http://127.0.0.1:8000/directorio/comunas'
  const fetchApi= async () =>{
    const response =await fetch(url)
    console.log(response.statusText)
    console.log(response.statusText)

  }
  const labels = [
    "January",
    "February",
    "March",
    "April",
    "May",
    "June",
    "July",
  ];
  const scores = [1, 2, 3, 4, 5, 6, 7];

  const data = {
    labels,
    datasets: [
      {
        label: "Mis datos",
        data: scores,
      },
    ],
  };

 
  return <Line data={data} options={{ responsive: true }} />;
}
